INSERT INTO tourist_attraction (id, city_id, name, description, latitude, longitude)
VALUES
('1c89645d-6b70-4e06-8100-02b68e77c23f', '24ea0c9e-f7d3-4236-8e24-9beea17895af', 'Cristo Redentor', 'Uma das sete maravilhas do mundo moderno, uma estátua gigante de Jesus Cristo no topo do Corcovado, oferecendo vistas deslumbrantes da cidade do Rio de Janeiro.', -22.9519, -43.2105),
('2b9e90df-b522-492f-bb8a-48551467c193', '24ea0c9e-f7d3-4236-8e24-9beea17895af', 'Pão de Açúcar', 'Um pico de granito com uma altura de 396 metros acima do nível do mar, com um teleférico que oferece vistas panorâmicas da Baía de Guanabara e da cidade.', -22.9519, -43.1658),
('4b855d95-9327-4c91-a818-87a7da75d48e', '24ea0c9e-f7d3-4236-8e24-9beea17895af', 'Copacabana', 'Uma das praias mais famosas do mundo, conhecida por sua calçada em forma de onda e uma vida noturna animada.', -22.9719, -43.1852),
('fcff4087-9c4c-4595-b1fd-0fd3243b0f62', '023c075e-ff47-4773-84a6-81cdb4de04ae', 'Pelourinho', 'Um bairro histórico conhecido por suas ruas de paralelepípedos, arquitetura colonial, igrejas barrocas e vida cultural vibrante.', -12.9738, -38.5025),
('82ac63f6-af84-440f-a2aa-69a2e15602d5', '023c075e-ff47-4773-84a6-81cdb4de04ae', 'Farol da Barra', 'Um dos cartões-postais de Salvador, um farol histórico localizado em uma fortaleza, oferecendo vistas panorâmicas do Oceano Atlântico.', -13.0084, -38.5311),
('4d4f7425-0444-40d2-8e42-150f39df9b4b', '023c075e-ff47-4773-84a6-81cdb4de04ae', 'Mercado Modelo', 'Um mercado histórico com lojas de artesanato, restaurantes e bares, oferecendo uma ampla variedade de produtos locais.', -12.9680, -38.5087),
('3fb9ec8d-e2a2-47cb-8edf-1e58d78f75b8', 'c437391c-60e2-4041-8cab-2e52f71e6527', 'Lagoa da Conceição', 'Uma lagoa cercada por morros, dunas e uma vila de pescadores, oferecendo atividades como windsurf, kitesurf, caiaque e passeios de barco.', -27.6146, -48.4514),
('ea02b125-97d9-4a22-8b09-8338587d0a79', 'c437391c-60e2-4041-8cab-2e52f71e6527', 'Praia Mole', 'Uma praia famosa por suas ondas fortes, frequentada por surfistas, e cercada por dunas e trilhas.', -27.6297, -48.4445),
('70f485e7-7ad7-44e8-8ba8-ee77f4374c36', 'c437391c-60e2-4041-8cab-2e52f71e6527', 'Mercado Público de Florianópolis', 'Um mercado público histórico com barracas de comida, lojas de artesanato, apresentações musicais e uma variedade de produtos regionais.', -27.5986, -48.5510);
